import React, { Component } from 'react'
import { Text, View , StyleSheet, ScrollView , FlatList  } from 'react-native'

class person extends Component {
    render() {
        const Data = [
            {id : 1 , menu : 'Menu 1'} , 
            {id : 2 , menu : 'Menu 2'} , 
            {id : 3 , menu : 'Menu 3'} ,
            {id : 4 , menu : 'Menu 4'} , 
            {id : 5 , menu : 'Menu 5'} ,
            {id : 6 , menu : 'Menu 6'} ,
            {id : 7 , menu : 'Menu 7'} ,
            {id : 8 , menu : 'Menu 8'} ,
            {id : 9 , menu : 'Menu 9'} ,
            {id : 10 , menu : 'Menu 10'} ,
            {id : 11 , menu : 'Menu 11'} ,
        ]

        return (
            <View>
                <FlatList data={Data} renderItem={(data2) => (
                    console.log(data2)
                )} />

            </View>
        )
    }
}

const Styles = StyleSheet.create({
    container : {
        padding : 10 
    } ,
    
    item : {
        padding : 10 , 
        textAlign : 'center' ,
        backgroundColor : 'green' , 
        marginTop : 10 ,
        fontWeight : 'bold' ,
        fontSize : 36
    }
})

export default person
